import { ActionTypes } from "../contants/action-types"

const initialstate = {
    products: [{
        id: 1,
        title: "Sandeep",
        category: "programmer"
    },
    ],
};

export const productReducer = (state, {type, payload}) => {
    switch (action.type) {
        case ActionTypes.SET_PRODUCTS:
            return state;
        default:
            return state;
    }
}
